  input: 'TEXT,F3A,,"In response to the letter from Chris Jones dated September 28,
    2006, the following is a list of the efforts we made to contact the individuals
    who did not provide us with their employer and occupation:   We sent a 1st letter
    notifying the individuals that in order to comply with FEC regulations, we needed
    their occupation and employer''s name.  We gave them the opportunity to email  the
    information to us or send the information back to us on the letter we sent them
    with  postage paid, self addressed envelope or to call us.  Those who did respond
    we have updated in the FEC file.  Those that did not respond to our 1st letter.  We
    contacted by telephone and when we had the opportunity to leave a message on an
    answering machine, we requested, again, the information required by the FEC as
    to their employer and occupation.  We also sent a SECOND REQUEST letter informing
    them of the need to comply with FEC regulations and to please provide us with
    their employer and occupation.   We have updated our files with all of the information
    we received from those individuals that did respond as of our October 31, 2006
    report."'
